import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="sidebar">
        <div className="sidebar-square"></div>
        <h1>Lilly Ko</h1>

      </div>
      <div className="main-content">
        <h1>Front-End Dev</h1>
        <h2>UX Designer</h2>

      </div>
    </div>
  );
}

export default App;
